import {
    FETCH_ALL_PLAYER
} from "../constants/actionTypes.js";

export default (players = [], action) => {
    console.log(action.type);
    switch (action.type) {
        case FETCH_ALL_PLAYER:
            return action.payload
        default:
            return players;
    }
};
